  input: 'TEXT,F3XA,,"In reference to you letter dated October 27, 2004 regarding
    the August Monthly Report (7/1/2004 - 7/31/2004): (1) The reports have been corrected   (2)
    The transaction listed under the name of Connie Nass have been corrected  to reflect
    that they were actually funds recieved from the Auditor of Indiana that reflect
    payment from individuals who purchase personalized licence plates. By state law
    these funds are forwarded to the political party whose plates are selected.  It
    is our understanding that these are permissible federal dollars. (3) Please note
    that there was a dollar for dollar reimbursement.  The difference is reflected
    in payroll taxes payable to the Internal Revenue Service, Indiana Department of
    Revenue, health insurance and other office expense or any other goods or services
    used on behalf of the federal candidates and committees.  The report has been
    amended to reflect the actual office expenses invoiced. (4) The payments made
    for postage were not mailings that refered to a clearly identified candidate for
    Federal office, nor did the mailings promote, support, attack or oppose any candidate
    for Federal office.  (5) Line 30(b) has been amended in the report. (6)  The Clipping
    and Press Service was not used for public communications that refer to a clearly
    idenified candidate for Federal office (7) The VAN was not used in connection
    w/any federal candidates."'
